import React from "react";

const Form = () => {
  return (
    <form>
      <input
        type="text"
        name="firstName"
        id="firstName"
        placeholder="First Name"
      />

      <input
        type="text"
        name="lasstName"
        id="lasstName"
        placeholder="Last Name"
      />
    </form>
  );
};

export default Form;
